import React from 'react'
import AdminMenu from '../components/AdminMenu';

const ListUsers = () => {
    return (
            <div className='container-fluid m-3 p-3' style={{minHeight:"90vh"}}>
                <div className='row'>
                    <div className='col-md-3'>
                        <AdminMenu/>
                    </div>
                    <div className='col-md-9'>
                        <h1 >
                            All Users
                        </h1>
                    </div>
                </div>
            </div>
    );
}

export default ListUsers;
